function TaskForm() {
    const [input, setInput] = useState("");

    return (
        <section className="task_outer">
            <form action="">
                <div className="form_field">
                    <input
                        type="text"
                        className="form_input"
                        placeholder="Add Task Tittle"
                        value={input}
                    />
                    <button>Add Task</button>
                </div>
            </form>
        </section>
    )
}

export default TaskForm;
